# This macro automates a lot of the frequency mapping process and simplifies the steps significantly.
[gcode_macro PROBE_EDDY_CURRENT_CALIBRATE_AUTO]
gcode:
  BED_MESH_CLEAR
  G28 X Y
  G1 X{ printer.toolhead.axis_maximum.x/2 } Y{ printer.toolhead.axis_maximum.y/2 } F6000
  {% if 'z' not in printer.toolhead.homed_axes %}
    SET_KINEMATIC_POSITION Z={ printer.toolhead.axis_maximum.z-1 } # Allows the user to work it down until it touches.
  {% endif %}
  PROBE_EDDY_CURRENT_CALIBRATE {rawparams}

#### end of EDDY ###

[pause_resume]

[gcode_macro M0]
gcode:
    PAUSE

[gcode_arcs]
#resolution: 1.0

[gcode_macro M117]
rename_existing: M117.1
gcode:
  {% if rawparams %}
    {% set escaped_msg = rawparams.split(';', 1)[0].split('\x23', 1)[0]|replace('"', '\\"') %}
    SET_DISPLAY_TEXT MSG="{escaped_msg}"
    RESPOND TYPE=command MSG="{escaped_msg}"
  {% else %}
    SET_DISPLAY_TEXT
  {% endif %}  

[gcode_macro HEAT_EXTRUDER]
gcode:
    M109 S{215}

[gcode_macro HEAT_BED]
gcode:
    M190 S{62}    

[gcode_macro HEAT_BOTH]
gcode:
    M140 S{62}
    M104 S{215}
      
[gcode_macro STARTUP]
gcode:
    G28
    M190 S{62}
    Z_TILT_ADJUST
    M104 S{150}
    G1 170, 190
    PROBE_EDDY_NG_TAP
    BED_MESH_CALIBRATE METHOD=rapid_scan

[gcode_macro M600]
gcode:
    {% set X = params.X|default(50)|float %}
    {% set Y = params.Y|default(0)|float %}
    {% set Z = params.Z|default(10)|float %}
    SAVE_GCODE_STATE NAME=M600_state
    PAUSE
    G91
    G1 E-.8 F2700
    G1 Z{Z}
    G90
    G1 X{X} Y{Y} F3000
    G91
    G1 E-150 F1000
    RESTORE_GCODE_STATE NAME=M600_state

[gcode_macro M0] 
gcode: 
    PAUSE

[gcode_macro ZUP]
gcode:
    SET_GCODE_OFFSET Z_ADJUST=0.01 MOVE=1

[gcode_macro ZDOWN]
gcode:
    SET_GCODE_OFFSET Z_ADJUST=-0.01 MOVE=1   

[mcu rpi]
serial: /tmp/klipper_host_mcu

#[adxl345]
#cs_pin: rpi:None

#[resonance_tester]
#accel_chip: adxl345
#probe_points:
#    239, 210, 20

[stepper_x]
step_pin: PF0
dir_pin: PF1
enable_pin: !PD7
microsteps: 16
rotation_distance: 40
endstop_pin: ^PE5
position_endstop: 352
position_min: 25
position_max: 352
homing_speed: 100

[stepper_y]
step_pin: PF6
dir_pin: PF7
enable_pin: !PF2
microsteps: 16
rotation_distance: 40
endstop_pin: ^PJ1
position_endstop: 350
position_min: 0
position_max: 350
homing_speed: 100

[stepper_z]
step_pin: PC1
dir_pin: PC3
enable_pin: !PC7
microsteps: 16
rotation_distance: 4
endstop_pin: probe:z_virtual_endstop
position_max: 404
position_min: -4
homing_speed: 10.0

[stepper_z1]
step_pin: PL3
dir_pin: PL1
enable_pin: !PK0
microsteps: 16
rotation_distance: 4

[z_tilt]
z_positions: 378, 228
          2, 228
points: 340, 190
          28, 190
speed: 180
horizontal_move_z: 5
retries: 10
retry_tolerance: .0050

[heater_bed]
heater_pin: PH5
sensor_type: EPCOS 100K B57560G104F
sensor_pin: PK6
#control: pid
#pid_Kp: 690.34
#pid_Ki: 111.47
#pid_Kd: 1068.83
min_temp: 0
max_temp: 130


[mcu]
serial: /dev/serial/by-id/usb-FTDI_FT232R_USB_UART_AR0JSV1S-if00-port0

#[filament_switch_sensor filament_sensor]
#switch_pin:PE4

[input_shaper]
#shaper_freq_x: 68.0
#shaper_type_x: mzv
#shaper_freq_y: 43.0
#shaper_type_y: ei

[printer]
kinematics: cartesian
max_velocity: 400
max_accel: 4050
max_z_velocity: 10
max_z_accel: 100

[screws_tilt_adjust]
screw1: 48, 90
screw1_name: front left screw
screw2: 321, 90
screw2_name: front right screw
screw3: 321, 350
screw3_name: rear right screw
screw4: 48, 350
screw4_name: rear left screw
horizontal_move_z: 5.
speed: 100
screw_thread: CW-M3

